import React from "react";
import { getAuth,signOut } from "firebase/auth";
import {useNavigate} from "react-router-dom";
export default ()=>{
    const navigate=useNavigate();
    const auth=getAuth();
    const onLogOutCLick=()=>{
        signOut(auth);
        navigate("/",{replace:true});
    }
    return(
        <>
            <button onClick={onLogOutCLick}>Log Out</button>
        </>
    )
}
